import React, { useState } from 'react';
import './Navbar.css';

const Navbar = ({ toggleSidebar }) => {
  return (
    <div className='header'>
      <div className="menu-toggle" onClick={toggleSidebar}>
        <div className="line"></div>
        <div className="line"></div>
        <div className="line"></div>
      </div>
      <p>Grievance Management System</p>
      <p>Hi User!</p>
    </div>
  );
}

export default Navbar;
